export const Marks = ({
    data,
    xScale,
    yScale,
    xValue,
    yValue,
    circleRadius
}) => {
    // Check for valid data
    if (!data || data.length === 0) {
        console.warn("No data available for rendering!");
        return null; // Prevent rendering if data is empty
    }

    return (
        <g className="marksline">
            {data.map((d, index) => (
                <circle
                    key={index}
                    cx={xScale(orderedDays[xValue(d)])} // Ensure this references DayOrder
                    cy={yScale(yValue(d))}
                    r={circleRadius}
                    fill="red"
                    stroke="black"
                />
            ))}
        </g>
    );
};
